                    <div class="result-info">
                        <h3>Lorem, ipsum.</h3>
                        <p class = "result-type">Lorem, ipsum dolor.&nbsp;&nbsp;&nbsp;Video</p>
                        <p class = "result-text">Lorem ipsum dolor sit amet, consectetur adipisicing elit. Corrupti ipsum nisi animi cum, dignissimos ut.</p>
                        <a href = "#" class = "button">Let's go</a>  
                    </div>
                </div>
            </div>

        </div>
    </div>
        </div>
    );
}
